CREATE TABLE IF NOT EXISTS data_numpang_uji (
  no_uji VARCHAR(255),
  no_pol VARCHAR(255),
  id_nama VARCHAR(255),
  id_chasis VARCHAR(255),
  kode_mesin_kendaraan VARCHAR(255),
  hasil_uji VARCHAR(255),
  tanggal_uji DATETIME,
  bulan INT,
  tahun INT
);

